import React from 'react'

const StageFour = ({ end, handlePoints }) => {
  const verifyPoints = () => {
    end();
    handlePoints();
  }

  return (
    <div>
        <h1>Gold Bicycle</h1>
        <div>
          <button className="car bike"></button>
          <button className="car bike2"></button>
        </div>
        <div>
          <button className="car bike3"></button>
          <button className="car bike4"></button>
        </div>
        <div className="button">
          <button className='button-87' onClick={end}> Verificar </button>
        </div>
    </div>
  )
}

export default StageFour;
